class Solution:
    def maxOperations(self, s: str) -> int:

        lst = [i for i in s]

        temp = 0
        cum = 0
        for i in range(len(lst) - 2, -1, -1):
            if s[i] == "1":
                if s[i + 1] == "0":
                    temp += 1
                cum += temp
        return cum
